import React from 'react';
import { Link } from 'react-router-dom';

export const Header = () => {
  return (
    <header>
      <nav>
        <div className='container'>
        <div>
        <ul>
          <li>
            <Link to="/">Watchlist</Link>
          </li>
          <li>
            <Link to="/watched">Watched</Link>
          </li>
          <li>
            <Link to="/add">Add</Link>
          </li>
        </ul>
        </div>
        </div>
      </nav>
    </header>
  );
};
